        static RSpline* castToBase(void* vp, /*RJSType ID*/ int t) {
          

          // hook for modules to cast from other types to base RSpline:
          for (int i=0; i<basecasters_RSpline.length(); i++) {
            RJSBasecaster_RSpline* basecaster = basecasters_RSpline[i];
            RSpline* ret = basecaster->castToBase(t, vp);
            if (ret!=nullptr) {
              return ret;
            }
          }

          // object is a pointer to base class RSpline:
          if (t==RJSType_RSpline::getIdStatic()) {
            return (RSpline*)vp;
          }

          qWarning() << "RSpline_Wrapper::castToBase: type not found: " << RJSHelper::getTypeName(t);

          return nullptr;
          
        }

        static RSpline* getWrappedBase(RJSWrapper* wrapper) {
          int t = wrapper->getWrappedType();
          void* vp = wrapper->getWrappedVoid();
          if (vp==nullptr) {
              //qWarning() << "getWrapped_RSpline*: wrapper wraps NULL";
          }

          RSpline* ret = castToBase(vp, t);
          if (ret==nullptr && vp!=nullptr) {
              qWarning() << "RSpline*_Wrapper::getWrappedBase: extracted type " << t << "from wrapper is NULL";
          }
          return ret;
        }
      
